window.bookSummaryJSON = "<p><b>From </b><b><i>New York Times</i></b><b> bestselling author Craig Alanson comes book four in the Convergence series, melding action-packed urban fantasy with his signature humor. Read by none other than award-winning narrator R.C. Bray.</b></p> <p>Kaz Wolfe has everything he needs to prevent a Convergence that would allow gods and monsters from the Nether to invade our world. Everything, other than a single clue about what a Convergence is. Or how it works. Or how to stop it. To get answers, he might have to take a fun-filled family road trip to the last place he wants to go: the Netherworld.</p>"; 
